--
-- Table structure for table `pro_customer`
--

DROP TABLE IF EXISTS `pro_customer`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `pro_customer` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '序号',
  `type` char(1) DEFAULT '1' COMMENT '用户类型(1用户，2司机)',
  `avatar` varchar(255) DEFAULT NULL COMMENT '头像地址',
  `name` varchar(255) DEFAULT NULL COMMENT '姓名',
  `nick_name` varchar(255) DEFAULT NULL COMMENT '昵称',
  `jim_name` varchar(255) DEFAULT NULL COMMENT '极光账号',
  `sex` char(1) DEFAULT NULL COMMENT '性别（0.男 1.女）',
  `age` int(11) DEFAULT NULL COMMENT '年龄',
  `working_age` int(10) DEFAULT NULL COMMENT '工龄',
  `height` decimal(10,2) DEFAULT NULL COMMENT '身高',
  `weight` decimal(10,2) DEFAULT NULL COMMENT '体重',
  `email` varchar(255) DEFAULT NULL COMMENT '邮箱',
  `bank` varchar(255) DEFAULT NULL COMMENT '银行卡',
  `number` varchar(20) DEFAULT NULL COMMENT '身份证号',
  `phone` varchar(255) DEFAULT NULL COMMENT '联系方式',
  `password` varchar(255) NOT NULL COMMENT '密码',
  `score` varchar(255) DEFAULT NULL COMMENT '评分',
  `car_total` varchar(255) DEFAULT NULL COMMENT '乘车次数',
  `rate` varchar(255) DEFAULT NULL COMMENT '回复率',
  `on_line_time` datetime DEFAULT NULL COMMENT '最终在线时间',
  `login_date` datetime DEFAULT NULL COMMENT '登录日期',
  `province` varchar(255) DEFAULT NULL COMMENT '省',
  `province_code` varchar(255) DEFAULT NULL COMMENT '省编号',
  `city` varchar(255) DEFAULT NULL COMMENT '市',
  `city_code` varchar(255) DEFAULT NULL COMMENT '市编号',
  `area` varchar(255) DEFAULT NULL COMMENT '区',
  `area_code` varchar(255) DEFAULT NULL COMMENT '区编号',
  `address` varchar(255) DEFAULT NULL COMMENT '主要出发地址',
  `lon_lat` varchar(255) DEFAULT NULL COMMENT '经纬度',
  `current_address` varchar(255) DEFAULT NULL COMMENT '当前位置',
  `content` varchar(255) DEFAULT NULL COMMENT '自我介绍',
  `code` varchar(255) DEFAULT NULL COMMENT '邀请码',
  `open_id` varchar(255) DEFAULT NULL COMMENT '微信openid',
  `qrcode` varchar(255) DEFAULT NULL COMMENT '分享码',
  `pro_code` varchar(255) DEFAULT NULL COMMENT '上级邀请码',
  `up_id` int(11) DEFAULT NULL COMMENT '上级编号',
  `money` decimal(10,2) NOT NULL COMMENT '余额',
  `integral` decimal(10,2) DEFAULT NULL COMMENT '积分',
  `start_time` datetime DEFAULT NULL COMMENT '开始日期',
  `end_time` datetime DEFAULT NULL COMMENT '到期日期',
  `open_flag` bit(1) DEFAULT NULL COMMENT '开通状态（0.未开通 1.已开通）',
  `watch_flag` bit(1) DEFAULT NULL COMMENT '观看状态（0.不可观看 1.可观看）',
  `push_url` varchar(255) DEFAULT NULL COMMENT '推流地址',
  `bond` int(11) DEFAULT NULL COMMENT '保证金',
  `bond_flag` char(1) DEFAULT NULL COMMENT '是否支付保证金',
  `contract_flag` char(1) DEFAULT NULL COMMENT '是否签署合同',
  `bond_file` varchar(255) DEFAULT NULL COMMENT '协议',
  `is_auth` char(1) DEFAULT '0' COMMENT '是否认证',
  `is_driver` char(1) DEFAULT NULL COMMENT '是否绑定汽车',
  `driving_license` varchar(1000) DEFAULT NULL COMMENT '驾照',
  `insurance` varchar(1000) DEFAULT NULL COMMENT '汽车保险',
  `insurance_certificate` varchar(1000) DEFAULT NULL COMMENT '车险证',
  `status` char(1) DEFAULT NULL COMMENT '启用状态（0.停用 1.启用）',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `del_flag` char(1) DEFAULT NULL COMMENT '删除标记',
  `number_image` text NOT NULL COMMENT '身份认证图片',
  `audit` char(1) NOT NULL COMMENT '审核状态',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='会员信息表';
/*!40101 SET character_set_client = @saved_cs_client */;

