--
-- Table structure for table `pro_order_info`
--

DROP TABLE IF EXISTS `pro_order_info`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `pro_order_info` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '序号',
  `customer_id` int(10) DEFAULT NULL COMMENT '用户id',
  `driver_id` int(10) DEFAULT NULL COMMENT '司机id',
  `route_id` int(10) DEFAULT NULL COMMENT '行程id',
  `order_type` char(1) DEFAULT NULL COMMENT '订单类型（1.商城订单 2.宅配卡订单 3.积分商城 4.加价购 5.砍价订单 6.拼团订单 7.秒杀订单 8.推荐有礼）',
  `order_code` varchar(255) DEFAULT NULL COMMENT '订单编号',
  `total_num` int(11) DEFAULT '0' COMMENT '总数量',
  `total_price` decimal(10,2) DEFAULT NULL COMMENT '总金额',
  `discount_price` decimal(10,2) DEFAULT NULL COMMENT '优惠金额',
  `actual_price` decimal(10,2) DEFAULT NULL COMMENT '实付金额',
  `bond_price` decimal(10,2) DEFAULT NULL COMMENT '保证金',
  `coupon_id` int(10) DEFAULT NULL COMMENT '优惠券编号',
  `integral` decimal(10,2) DEFAULT NULL COMMENT '实付积分',
  `freight` decimal(10,2) DEFAULT NULL COMMENT '运费',
  `package_id` int(10) DEFAULT NULL COMMENT '套餐编号',
  `send_time` datetime DEFAULT NULL COMMENT '配送时间',
  `send_cnt` int(10) DEFAULT NULL COMMENT '配送箱数',
  `people` varchar(50) DEFAULT NULL COMMENT '收货人',
  `phone` varchar(100) DEFAULT NULL COMMENT '联系电话',
  `address` varchar(255) DEFAULT NULL COMMENT '收货地址',
  `pay_type` char(1) DEFAULT NULL COMMENT '支付方式（1.微信支付 2.支付宝支付 3.积分支付 4.微信+积分支付）',
  `pay_time` date DEFAULT NULL COMMENT '支付时间',
  `push_people` int(100) DEFAULT NULL COMMENT '发货人',
  `order_status` char(1) DEFAULT NULL COMMENT '订单状态(待确认价格，待支付，已支付，已完成)',
  `take_type` char(1) DEFAULT NULL COMMENT '收货方式',
  `storehouse` varchar(255) DEFAULT NULL COMMENT '仓库名称',
  `start_address` varchar(255) DEFAULT NULL COMMENT '出发地',
  `end_address` varchar(255) DEFAULT NULL COMMENT '目的地',
  `start_time` datetime DEFAULT NULL COMMENT '出发时间',
  `end_time` datetime DEFAULT NULL COMMENT '到达时间',
  `create_time` datetime DEFAULT NULL COMMENT '下单时间',
  `del_flag` char(1) DEFAULT NULL COMMENT '删除标记',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=764 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='订单信息表';
/*!40101 SET character_set_client = @saved_cs_client */;

