INSERT INTO `sys_agreement` VALUES (1,'11','<p><strong>事業者                                                                                                                                                                                     </strong>WaysLink株式会社 </p><p class=\"ql-align-right\">（英語表記：WaysLink, Inc.）</p><p class=\"ql-align-right\"><br></p><p><strong>代表者                                                                                                                                                                                     </strong>			上地佑来测</p><p><br></p><p><strong>事業内容                                                                                                                                                  </strong>女性専用ライドシェア「Wely」の運営</p><p><br></p><p><strong>所在地                                                                                                                                          </strong>	〒901-1104　沖縄県南風原町字宮平894－11</p><p class=\"ql-align-right\">（代表電話番号：　　　　）</p><p class=\"ql-align-right\"><br></p><p><strong>メールアドレス                                                                                                                                                  </strong>					 info@wayslink.me</p><p><br></p><p><strong>販売価格（役務の対価)                                                                                                                                    </strong>商品毎に記載（すべて消費税込）</p><p><br></p><p><strong>お支払時期                                                                                                                                  </strong>							ドライブが実際に行われた時</p><p><br></p><p><strong>役務の提供時期                                                                                                                                 </strong>					 ドライブ情報に設定された日時</p><p><br></p><p><strong>キャンセルについて                                                                                                                                 </strong>					 								無料</p><p><br></p><p><strong>販売価格（役務の対価）以外の必要料金                                                                                                                                </strong>					 	なし</p><p><br></p><p><strong>ご連絡                                                                                                                                </strong>					 								 info@wayslink.me</p>','1','',NULL,'','2024-09-05 14:29:24',NULL,'0'),(2,'12','<p class=\"ql-align-center\"><strong class=\"ql-size-huge\">Wely サービス利用規約</strong></p><p><span class=\"ql-size-huge\">&nbsp;</span></p><p><br></p><p><br></p><h1 class=\"ql-align-center\">第1章　はじめに</h1><h2>第1条　定義等</h2><p>本規約はWaysLink株式会社（以下「弊社」といいます。）がウェブサイト（wely.info）（以下「本サイト」といいます。）を運営することにより提供するサービスについて適用されます。</p><p>本規約の中で使用される以下の各用語は、次の通りとします。</p><p>&nbsp;</p><p>「ライド・シェア」とは、自動車のドライバー（以下「ドライバー」といいます。）と相乗り希望者（以下「利用者」といいます。）が自動車の相乗り行為を行うことを指します。</p><p>「本規約」とは、本サービス利用規約を指しますが、弊社が本サービスの運営にあたり別途規定する「本サービスご利用上の注意点」「FAQ」など、本サイト上に掲示する各種ルール、各種取り決めも本規約の一部を構成するものとします。</p><p>「参考実費」とはドライブに要するガソリン代、有料道路使用料、移動サービス専用保険料の見込み合計額をいいます。</p><p>「支払い金額」とはドライブ当日の利用者の人数に応じて自動計算により算出した、一人当たりにご負担いただく費用をいい、全ての利用者の支払い金額の合計は参考実費以下である必要があります。</p><p>「ドライバー」とは、本サイトを利用して、ドライブ情報（出発・到着日時、出発場所、経由場所、到着場所等）及び条件（乗車可能人数、ドライブに要する支払い金額）を登録して、利用者からのライド・シェアの申し込みを承認し、ライド・シェアを行う者をいいます。</p><p>「利用者」とは、本サイトを利用して、ドライブ情報を検索及び自ら移動ルートの希望条件（出発・到着日時、出発場所、経由場所、到着場所等）を登録しして、ドライバーからのライド・シェアの申込の誘因を受け、ライド・シェアの申込を行う者をいいます。</p><p>「会員」とは、本規約を承認し、サービスを利用するために弊社所定の入会登録を行い、弊社がその入会登録を承認した個人、法人及び団体をいいます。</p><p>「会員等」とは、会員、会員登録の申込者及び本サイトの閲覧者など、本サイトの利用を認められる個人、法人及び団体をいい、特に断らない限り、サイト閲覧者も含まれるものとします。</p><p>「サービス」とは、本サイトにおいて会員が利用することができるサービスをいいます。</p><p>「ユーザーアカウント」とは、会員によって本サイトに開設されサービスを享受するために利用されるアカウントをいいます。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第2条　本規約への同意</h2><p>サービスを利用するには、本規約に同意の上、会員となる必要があります。本規約は、本サイトを利用するあらゆる場面に適用されます。本サイトを利用する場合、会員は、本規約の各条項が適用されることを承諾していただく必要があります。本規約の各条項が適用されることを承諾いただけない場合には、サービスをご利用になれません。また、会員が本規約の各条項に従うことができない場合には、弊社は、事前通知なく当該会員のユーザーアカウントを削除し、あらゆるサービスの提供を停止せざるを得なくなることをご了解ください。</p><p>本規約は、全ての会員に適用され、会員登録手続時及び登録後に、お守りいただくことが必要となります。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第3条　個人情報保護方針への同意</h2><p>本サービスは、個人情報保護方針に従って提供され、会員の個人情報は、当該個人情報保護方針に従って取り扱われます。</p><p>会員等は、サービスの利用又は本サイトの閲覧の前に、個人情報保護方針を必ず確認し、その内容に同意の上、サービスのご利用又は本サイトの閲覧をしてください。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第4条　規約の変更・追加</h2><p>弊社は、いかなる場合でも会員等に事前に通知することなく、本規約の全部又は一部を任意に変更でき、また本規約を補充する規約・特約を新たに定めることができるものとします。規約の変更・追加は、本サイトに掲示した時点から効力を有するものとします。</p><p>会員等は、前項の内容を十分に理解し、定期的に本規約の最新の内容を確認する義務を負うものとし、弊社に対して、規約の変更・追加に関する不知を申し立てることを禁止します。</p><p>弊社は、規約の変更・追加により会員等が被った一切の損害、損失又は費用(以下、総称して｢損害等｣という。)につき一切の責任を負わないものとします。</p><p>&nbsp;</p><p><br></p><p><br></p><h1 class=\"ql-align-center\">第2章　会員資格</h1><h2>第5条　会員登録</h2><p>サービスを利用するためには、本サイトにて会員登録をしていただく必要があります。会員登録に際しては弊社が本サイト会員登録フォームにて指定する個人情報等をご提供いただく必要がありますことをご了解ください。</p><p>会員登録手続は、会員となる本人が行う必要があり、会員となる本人以外が行う登録は一切認められません。</p><p>会員が、会員登録時及び会員登録後に弊社が提供するサービスを利用するにあたり、虚偽の登録を行うことを禁止します。会員は、真実かつ正確な情報を登録する義務を負います。</p><p>登録内容の変更がある場合は、会員は、直ちに登録内容を修正し、常に会員自身の正確な情報が登録されているよう、登録内容を管理・修正する責任を負います。</p><p>登録内容に変更があったにもかかわらず、会員が変更の届出をしていない場合、弊社は、登録内容の変更がないものとして取り扱うことができます。変更の届出があった場合でも、変更登録前に行われた取引や各種手続は、変更登録前の情報に準拠することがあります。</p><p>会員が会員登録をしたことにより生じた損害等及び会員が前各項の規定に違反したために被った損害等に関し、弊社は一切責任を負いません。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第6条　会員資格</h2><p>次の各号いずれかに該当する場合は、サービスをご利用いただくことができません。</p><p>(1) 自らの責任のもとサービスを利用することが困難な方</p><p>(2) 暴力団、暴力団関係企業、総会屋、これらに準ずる者若しくはその構成員と認められる場合、又は公の秩序又は善良な風俗を乱す恐れがあると弊社が判断した場合</p><p>(3) 過去の利用において、本規約に違反した場合</p><p>(4) その他、弊社が適当でないと認めた場合</p><p>会員は複数の会員IDを持つことができないものとします。</p><p>会員は、会員資格の譲渡や貸与は一切おこなえないものとします。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第7条　会員資格の取消等</h2><p>弊社は、会員が下記のいずれかに該当したと判断した場合、事前の通知なく、会員資格の取消し、会員に関連する情報の全部若しくは一部を削除又は将来にわたって本サイトのご利用をお断りする場合があります。その場合、弊社は当該会員にその理由を説明する義務を負わないものとします。</p><p>(1) 法令又は本規約に違反した場合</p><p>(2) 不正行為があった場合</p><p>(3) 会員が登録した情報を弊社が虚偽の情報であると判断した場合</p><p>(4) 他の会員や第三者に不当に迷惑をかけたと弊社が判断した場合</p><p>(5) 他の会員や第三者とのトラブルの発生率が、故意・過失を問わず一定水準を超えた場合</p><p>(6) 本サイトの継続的な提供が合理的な理由により困難であると弊社が判断した場合</p><p>(7) 暴力団、暴力団関係企業、総会屋、これらに準ずる者若しくはその構成員と認められる場合、又は公の秩序又は善良な風俗を乱す恐れがあると弊社が判断した場合</p><p>(8) その他弊社が会員に相応しくないと判断した場合</p><p>弊社は、本条の措置により生じる一切の損害等について、直接的か間接的かを問わず、一切の責任を負わないものとします。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第8条　会員の退会</h2><p>会員が退会を希望する場合は、弊社所定の手続により退会することができます。ただし、退会の手続を行った時点で、取引の決済など、取引の手続において未完のものがある場合は退会することができません。</p><p>&nbsp;</p><p><br></p><p><br></p><h1 class=\"ql-align-center\">第3章　本サイト及びサービスの利用</h1><h2>第9条　商業目的・利用の禁止</h2><p>本サイト及びサービスは、専らドライバーと利用者のライド・シェアの利用目的に厳格に制限されており、ドライバーによる利益を得ることを目的とした活動には適用されず、弊社はそうした活動を厳格に禁止しております。</p><p>ドライバーは、ライド・シェアによるドライブ（本サイトを通じて合意した内容を超えるものも含みます。）によって何ら利益を得ないものとし、利用者からドライバーへは支払い金額のみが支払われるものとします。</p><p>ドライバーが利益を得ることを目的として利用者に追加のサービスを提供することは禁止され、利用者がかかる追加のサービスを受け又は追加のサービスを行うようにドライバーに依頼することも禁止します。</p><p>利益を得ることを目的としたライド・シェアを行った場合、ドライバーは道路運送法違反（いわゆる白タク行為）等の罰則を受け又は運転免許証取消等の処分が課せられる可能性についてご留意ください。かかる場合に、会員に生じた損害等に関し、弊社は一切責任を負いません。</p><p>貨物自動車運送事業に供される車両をライド・シェアに用いることは禁止します。かかる車両でライド・シェアを行なった場合、ドライバーは道路運送法違反（いわゆる白タク行為）等の罰則を受け又は運転免許証取消等の処分が課せられる可能性についてご留意ください。これにより会員に生じた損害等に関し、弊社は一切責任を負いません。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第10条　弊社の立場</h2><p>本サイトは、会員がライド・シェアを行うために、会員同士が互いに交渉を行うためのコミュニケーションプラットフォームとなります。弊社は、会員に本サイトを通じたサービスを提供するのみであり、輸送サービスは一切提供しません。</p><p>ライド・シェアの合意は、ドライバーと利用者との間のみで締結されるものであり、弊社は契約の当事者となりません。また、弊社はいかなる会員の代理等も致しません。そのため、弊社はライド・シェアの合意が実際に履行されることを保証するものではなく、会員間で生じる以下の事項について一切責任を負いません。</p><p>(1) ドライバー及び利用者間の活動におけるトラブル又は事故</p><p>(2) ドライバー又は利用者が法令又は本サイトの利用規約に違反した場合に、ドライバー若しくは利用者又は第三者に発生した損害等</p><p>(3) 本サイトにおけるサービスに関してドライバー若しくは利用者又は第三者が被った損害等</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第11条　ライド・シェアの合意</h2><p>ドライバーは、本サイトにおいて、ユーザーアカウントを通じて、必要に応じてドライブ情報（出発・到着日時、出発場所、経由場所、到着場所等をいいます。以下同じです。）及びドライブ条件（乗車可能人数、ドライブに要する支払い金額等をいいます。以下同じです。）を入力し、利用者は本サイトにおいてドライブ情報を検索し、ドライバーとの間でライド・シェアの合意をするものとし、 弊社は何らの調整等の役割を担いません。また、弊社は、合意の前提となったドライバーの個人情報、利用者の個人情報、ドライブ情報及びドライブ条件が、真実かつ正確であるよう努めるものとしますが、保証の限りではありません。なお、ドライバー及び利用者は、ドライブ確定前にライド・シェアを拒否する権利を平等に有しています。</p><p>ライド・シェアの合意が成立した場合、利用者は、ドライバーに対してドライブ条件にて提示された支払い金額を負担するものとし、利用者はドライブの終了時に弊社が指定する手段にて電子決済により支払うものとします。</p><p>ドライバーは、ドライブ終了後速やかに、支払金額を弊社が指定する手段で利用者に精算させるとともに、弊社が定める所定の手数料を支払うものとします。</p><p>&nbsp;</p><p><br></p><p><br></p><h1 class=\"ql-align-center\">第4章 ドライバー及び利用者並びに会員の義務</h1><h2>第12条　ドライバーの義務</h2><p>ドライバーは、合意されたライド・シェアについて、予定が変更された場合には、速やかに利用者にその旨連絡し利用者から変更について受諾を得るように努力するものとします。</p><p>ドライバーは、利用者と合意した場所に、合意した時間に到着するように努力するものとし、遅延する場合等には速やかに利用者に連絡をするようにします。</p><p>ドライバーは有効な運転免許証を有することや、自動車損害賠償責任保険の加入などの自動車運転に必要な法的要件を満たす必要があります。また、ドライバーは、ライド・シェアに用いる車の所有権又は使用権を有すると共に、その車が公道を走行する法的資格、および、安全性を有することを担保するものとします。なお、弊社は、ドライバーが保険に加入しているか、ドライバーは有効な運転免許証を有しているか、車の所有権又は使用権を有するか等、本項で定める義務について何ら保証するものではありません。</p><p>ドライバーが本規約の各条項を順守することができなかった場合、弊社は当該違反の情報を本サイト上にて開示することができるものとし、ドライバーは予め異議なく同意するものとします。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第13条　利用者の義務</h2><p>利用者は、合意されたライド・シェアについて、予定が変更された場合には、直ちにドライバーにその旨連絡するものとします。</p><p>利用者は、ドライバーと合意した場所に、合意した時間に到着するように努力するものとし、遅延する場合等には速やかにドライバーに連絡をするようにします。</p><p>利用者が本規約の各条項を順守することができなかった場合、弊社は当該違反の情報を本サイト上にて開示することができるものとし、利用者は予め異議なく同意するものとします。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第14条　禁止行為</h2><p>弊社は、会員等が、下記各号に掲げる行為を行うことを禁止します。会員等がこれらの行為を行ったと弊社が判断した場合、弊社は、当該会員等に対する事前の通知なしに、当該会員の資格取消、当該会員が掲示した情報の削除、当該会員等による本サイトの利用停止その他弊社が必要と判断する措置を講じることができるものとします。</p><p>(1) 本規約に違反する行為</p><p>(2) 法令の定めに違反する行為、法令違反を助長する行為又はそれらのおそれのある行為</p><p>(3) 他の会員等、第三者又は弊社の財産、名誉、信用、プライバシー若しくはパブリシティー権又は著作権、商標権、特許権その他の権利を侵害する行為、侵害を助長する行為又はそれらのおそれのある行為</p><p>(4) 本サイトの利用に関連して知り得た弊社又は他の会員等の秘密に属すべき情報を開示、公開する行為</p><p>(5) 本サイトを利用して他の会員等又は第三者を他のウェブサイトに誘導する行為</p><p>(6) 本サイトを介さずに行う直接取引やそれを勧誘する行為</p><p>(7) 本サイト外で本サイト及び本サイト付随機能を商業目的で利用する行為、無限連鎖講及びマルチ商法、又はそれに類するもの、そのおそれのあるもの、あるいは弊社が無限連鎖講及びマルチ商法、又はそれに類するもの、そのおそれのあるものと判断する内容を掲載する行為</p><p>(8) 本サイト若しくは本サイトの一部（コンテンツ・情報・機能・システム・プログラム等）を使用・転用・転売・複製・送信・翻訳・翻案などして、いかなる手法を問わず商業・営業目的の活動、営利を目的とした利用及びその準備を目的とした利用をすること、その他本サイトの二次利用や複製行為</p><p>(9) 会員の個人情報を開示し又はその開示を要求する行為（ただし、ドライバーによるライド・シェアの承認後に、ドライバーと利用者間で連絡先の交換を行う場合を除く）</p><p>(10) 卑猥な文章図画を掲載する行為</p><p>(11) グロテスクな画像など、多くの人が不快感を抱く可能性が高い文章や図画を掲載する行為</p><p>(12) 政治的プロパガンダを掲載する行為</p><p>(13) 異性交際対象の募集をする行為</p><p>(14) 公序良俗に反する行為</p><p>(15) 本サイトのセキュリティホールやバグの利用・不正アクセスや人為的な高負荷アクセスを発生させる行為、本サイトによりアクセス可能な本サイト又は他者の情報を改ざん、消去する行為、他者の設備又は本サイト用設備（本サイトがサービスを提供するために用意する通信設備、通信回線、電子計算機、その他の機器及びソフトウェアをいいます。）に無権限でアクセスし、又はその利用若しくは運営に支障を与える行為</p><p>(16) 本サイトにコンピュータウィルス等の不正プログラムを送信する行為、又は他者が受信可能な状態におく行為</p><p>(17) 本サイトを経由して、会員等及び第三者が行政手続における特定の個人を識別するための番号の利用等に関する法律（平成25年法律第27号。以下「番号法」 という。）に基づく個人番号及び個人番号をその内容に含む特定個人情報（これら情報を第三者に推知せしめることにつながる一切の情報を含む。）の開示を行ったり、収集を行うなど、これら情報の第三者への漏洩等に繋がる危険性のある一切の行為</p><p>(18) 前号のほか、番号法に違反する、あるいはそのおそれのある一切の行為</p><p>(19) 前各号の他、弊社が不適切と判断した行為</p><p>(20) 第11条1項なお書きで言及した禁止行為に違反した行為</p><p>前項の措置を講じたことにより、または前項に違反したことにより、会員等に損害等又は不利益が生じたとしても、弊社は一切の責任を負わないものとします。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第15条　弊社の知的財産権</h2><p>本サイトに含まれる工業所有権、ノウハウ、プログラム、著作権その他の知的財産権及びそれらに関連する全ての権利は弊社に帰属するものとし、あらかじめ弊社より書面による承諾を得た場合を除いて、これらの複製、販売などはできないものとします。</p><p>&nbsp;</p><p><br></p><p><br></p><h1 class=\"ql-align-center\">第5章　免責</h1><h2>第16条　サービスの中断</h2><p>弊社は、システムの保守、システム障害対応、天災等の不可抗力、その他技術上、運用上の理由により、サービスの提供を中断する必要があると判断した場合、事前に会員等に通知することなく、サービスの提供を一時的に中断できるものとします。</p><p>弊社は、前項の措置に関連して、会員等に損害等又は不利益が生じたとしても、一切責任を負わないものとします。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第17条　サービスの終了・変更等</h2><p>弊社は、何らの予告なく、弊社の任意の判断で、サービスの全部又は一部を終了し、一時停止し、変更し又は追加できるものとします。</p><p>弊社は、前項のサービス終了、一時停止、変更又は追加に起因する一切の損害等について、会員及び第三者に対して一切責任を負いません。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第18条　サービス水準等の非保証等</h2><p>弊社は、サービスの内容・品質・水準、サービスの安定的な提供、サービスの利用に伴う結果などについては、一切保証しないものとします。</p><p>サービス提供における、不正確・不適切・不明瞭な内容・表現・行為などにより、会員等及び第三者に対して直接的又は間接的な損害等が生じた場合であっても、故意・過失の有無にかかわらず、弊社は、当該損害等について一切責任を負わないものとします</p><p>弊社は、会員等に対して、任意に情報提供を行う場合がありますが、それらに対して責任を負うものではなく、その正確性や有用性を保証しません。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第19条　システム等についての非保証</h2><p>弊社は、本サイト及びそれに関連するコンテンツの中に、コンピュータウィルスなど有害なものが含まれていないことを保証しないものとします。弊社は、本サイト及びそれに関連するコンテンツの中に、コンピュータウィルスなど有害なものが含まれていたことにより生じた一切の損害等について、会員等及び第三者に対して一切責任を負わないものとします。</p><p>弊社は、本サイトへのアクセス不能、会員等のコンピュータにおける障害、エラー、バグの発生等について、一切の責任を負わないものとします。</p><p>弊社は、コンピュータ、システム、通信回線などの障害により、会員等及び第三者に生じた一切の損害等（データ消失、システムの中断、不正アクセスなど）について、一切責任を負わないものとします。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第20条　広告・リンク先による損害等</h2><p>本サイトに掲載されている広告や弊社から会員に送信する電子メールに掲載されている広告によって、会員等及び第三者に生じる損害等に関し、弊社は一切責任を負いません。</p><p>会員等が書き込んだ他のウェブサイトやリソースへのアクセスにより生じた直接的又は間接的な損害等について、弊社は一切責任を負いません。</p><p>&nbsp;</p><p><br></p><p><br></p><h1 class=\"ql-align-center\">第6章　その他</h1><h2>第21条　弊社からの通知</h2><p>弊社は、本サイトへの掲示その他弊社が適当と判断する方法及び範囲で、会員等への通知を行うものとします。</p><p>前項に定める通知は、弊社が当該通知の内容を本サイトに掲示した時点から効力を有するものとします。また、前項に定める通知をメール配信等により実施した場合には、当該通知が会員等に到達した時点から効力を有するものとします。</p><p>弊社からの通知及び連絡が不着であったり遅延したりといったことによって生じる損害等において、弊社は一切の責任は負いません。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第22条　準拠法・裁判管轄</h2><p>本規約は日本法に基づき解釈されるものとし、会員等と弊社の間で生じた紛争については、その訴額に応じて東京簡易裁判所又は東京地方裁判所を第一審の専属的合意管轄裁判所とします。</p><p>&nbsp;</p><p><br></p><p><br></p><h1 class=\"ql-align-center\">第7章　個人情報</h1><h2>第23条　個人情報等</h2><p>当社は、本サービスの提供に関連して会員の個人情報等を取り扱う場合、個人情報保護法及びその他ガイドラインに則り、当該情報を取り扱うものとします。</p><p>当社は、本サービスを提供するに当たり、当社が了知した個人情報等について、以下各号に定める目的で利用するものとし、会員は予めこの点について了承するものとします。</p><p>(1) 本サービスを提供し、会員を管理するために必要な場合（本人確認等をする場合を含みます。）</p><p>(2) 当社各種サービスのご案内等(ダイレクトメールの送付、電子メールの送信を含みます。)を行う場合</p><p>(3) 本規約や法律等に基づく権利の行使や義務の履行の場合</p><p>(4) 本サービスの品質管理・品質向上のために行うマーケティング調査及び分析に利用する場合</p><p>(5) 本サービスの各種問い合せに対応する場合やアフターサービスを行う場合</p><p>(6) 本サービスの提供に関する事柄についての連絡、追加サービス等の情報提供を行う場合</p><p>(7) 本サービスにおけるシステムの維持、不具合対応を行う場合</p><p>(8) その他、当社が会員に事前連絡の上、個別に了承をいただいた目的に利用する場合</p><p>当社は、会員の個人情報等を、以下のいずれかの事由に該当する場合を除き、本人以外の第三者に開示しないものとし、かつ本サービスを提供していく上で必要な範囲を超えて利用しないものとします。</p><p>(1) 会員の同意が得られた場合</p><p>(2) 本サービスに関して、当社の権利行使に必要な場合</p><p>(3) 合併、営業譲渡その他の事由による事業の承継の際に事業を承継する者に対して開示する場合</p><p>(4) 個人情報保護法その他の法令により認められた場合</p><p>(5) 官公庁等の公的機関から法令に基づき開示を求められた場合</p><p>(6) 利用目的の達成に必要な範囲内において個人情報の取扱いの全部又は一部を委託することに伴って個人情報を提供する場合</p><p>会員は、当社が本条第2項及び3項に定める目的で個人情報等を収集・利用することについて、予め了承するものとします。</p><p>会員は、本サービスに関連して当社に提供した個人情報等について、開示、削除、訂正または利用停止の請求ができるものとし、本人からの請求であることが確認できる場合に限り、当社はこれに速やかに対応するものとします。</p><p>当社の本件問合せ窓口は以下の通りとします。</p><p>Wely 運営事務局</p><p>メールアドレス：info@wayslink.me</p><p>&nbsp;</p><p class=\"ql-align-right\">以上</p><p>&nbsp;</p>','1','',NULL,'','2024-09-04 17:56:44',NULL,'0'),(3,'13','<p class=\"ql-align-center\"><strong class=\"ql-size-huge\">プライバシーポリシー</strong></p><p>&nbsp;</p><p>WaysLink株式会社（以下「当社」といいます。）は、個人情報保護の重要性を認識し、お客様の氏名、住所、生年月日、電話番号、eメールアドレス、銀行口座番号、クレジットカードに関する情報、SNSのアカウント情報等お客様を特定することができる情報（以下「個人情報」といいます。）を保護することが社会的責務であると考え、個人情報に関する法令及び社内規程等を遵守し、当社で取扱う個人情報の取得、利用、管理を適正に行います。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>１．個人情報の取得・利用目的</h2><p>当社は、お客様からいただく個人情報の利用目的をあらかじめ明確に定め、適法かつ公正な手段により、必要な範囲で個人情報を取得し、以下の利用目的の範囲内において、個人情報を利用させて頂きます。</p><p>&nbsp;</p><p>1.&nbsp;当社が運営する自動車の相乗りに係るマッチングのためのプラットフォームサイト（以下「本サイト」といいます。）の運営（以下「本運営」といいます。）及びそれに付帯するサービスの提供のため</p><p>2.&nbsp;本サイトを利用する他の会員に、お客様が同意された範囲内の個人情報を提供するため</p><p>3.&nbsp;本運営における当社サービスに関する情報のお知らせのため</p><p>4.&nbsp;お客様からのお問い合わせ又はご依頼等への対応のため</p><p>5.&nbsp;お客様に対してサービスについてご意見をお伺いするため</p><p>6.&nbsp;本運営・キャンペーン等に関する情報をご提供するため</p><p>7.&nbsp;アンケートやキャンペーンによる謝礼・賞品など、イベントの企画・運営のため</p><p>8.&nbsp;本運営の内容改善や統計情報などに用いるため</p><p>&nbsp;</p><p><br></p><p><br></p><h2>２．個人情報の委託</h2><p>当社は、利用目的の達成に必要な範囲内において、契約関係にある業務提携先に個人情報処理を委託する場合など、利用目的の達成に必要な範囲内において、お客様の個人情報を外部業者に委託することがあります。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>３．第三者提供</h2><p>当社は、前項の目的及び次のいずれかに該当する場合を除き、お客様から取得した個人情報を、第三者に提供しません。</p><p>&nbsp;</p><p>1.&nbsp;お客様ご本人の同意がある場合</p><p>2.&nbsp;法令に基づく場合</p><p>3.&nbsp;人の生命、身体又は財産の保護のために必要がある場合であって、お客様ご本人の同意を得ることが困難であるとき</p><p>4.&nbsp;国の機関若しくは地方公共団体又はその委託を受けた者が法令の定める事務を遂行することに対して協力する必要がある場合であって、お客様ご本人の同意を得ることにより当該事務の遂行に支障を及ぼす恐れがあるとき</p><p>5.&nbsp;合併、会社分割、営業譲渡その他の事由によって事業の承継が行われる場合</p><p>&nbsp;</p><p><br></p><p><br></p><h2>４．訂正、追加又は削除</h2><p>当社が保有するお客様情報に関して、お客様ご自身の情報の内容について訂正、追加または削除をご希望になる場合には、お申し出いただいた方がご本人であることを確認した上で、事実と異なる内容がある場合には、合理的な期間及び範囲で情報内容を訂正、追加または削除いたします。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>５．利用停止、消去</h2><p>当社が保有するお客様情報に関して、お客様ご自身の情報の利用停止または消去をご希望される場合には、お申し出いただいた方がご本人であることを確認した上で、合理的な期間および範囲で利用停止または消去いたします。なお、利用停止又は消去に伴い、不本意ながらご要望に沿ったサービスの提供ができなくなることがありますので、ご理解とご協力を賜りますようお願い申し上げます（なお、関係法令に基づき保有しております個人情報については、利用停止又は消去のご請求には応じられない場合があります）。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>6．準拠法について</h2><p>当社が保有するお客様の個人情報については日本国法を適用します。また、当社は個人情報について適用される法令を遵守し、法令の変更等、必要に応じて各項目の変更を行ないます。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>7. クッキー、アクセスログ、webビーコン</h2><p>本サイトでは、利便性の向上、内容の充実、不正アクセスの防止等を目的として、Cookie（ブラウザを通してPC上に保存されるファイル）やアクセスログ（アクセス状況等をサーバ上に記録するファイル）、WEBビーコン（特定ページへのアクセス数を記録する等の目的で、WEBサイト上に組み込まれる画像ファイル）を使用する場合があります。取得・利用する情報は、IPアドレス、ブラウザの種類、閲覧したページ等になります。Cookie、アクセスログ、WEBビーコンいずれについても、利用者名やメールアドレス等の個人情報は取得致しません。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>8．個人情報に関するお問い合わせ</h2><p>お客様からお客様ご本人の個人情報についての開示・訂正・利用停止等のご依頼や、その他苦情・相談等のお申し出があった場合には迅速に対応いたします。お申し出は、こちらからご連絡ください。</p><p>&nbsp;</p><p>&nbsp;</p><p>Welyサポート窓口</p><p>受付：平日9時～16時</p><p>Email：info@wayslink.me</p><p>&nbsp;</p>','1','','2024-07-09 15:40:57','','2024-09-04 17:56:51',NULL,'0');
