す。「サービス」とは、本サイトにおいて会員が利用することができるサービスをいいます。「ユーザーアカウント」とは、会員によって本サイトに開設されサービスを享受するために利用されるアカウントをいいます。&nbsp;第2条　本規約への同意サービスを利用するには、本規約に同意の上、会員となる必要があります。本規約は、本サイトを利用するあらゆる場面に適用されます。本サイトを利用する場合、会員は、本規約の各条項が適用されることを承諾していただく必要があります。本規約の各条項が適用されることを承諾いただけない場合には、サービスをご利用になれません。また、会員が本規約の各条項に従うことができない場合には、弊社は、事前通知なく当該会員のユーザーアカウントを削除し、あらゆるサービスの提供を停止せざるを得なくなることをご了解ください。本規約は、全ての会員に適用され、会員登録手続時及び登録後に、お守りいただくことが必要となります。&nbsp;第3条　個人情報保護方針への同意本サービスは、個人情報保護方針に従って提供され、会員の個人情報は、当該個人情報保護方針に従って取り扱われます。会員等は、サービスの利用又は本サイトの閲覧の前に、個人情報保護方針を必ず確認し、その内容に同意の上、サービスのご利用又は本サイトの閲覧をしてください。&nbsp;第4条　規約の変更・追加弊社は、いかなる場合でも会員等に事前に通知することなく、本規約の全部又は一部を任意に変更でき、また本規約を補充する規約・特約を新たに定めることができるものとします。規約の変更・追加は、本サイトに掲示した時点から効力を有するものとします。会員等は、前項の内容を十分に理解し、定期的に本規約の最新の内容を確認する義務を負うものとし、弊社に対して、規約の変更・追加に関する不知を申し立てることを禁止します。弊社は、規約の変更・追加により会員等が被った一切の損害、損失又は費用(以下、総称して｢損害等｣という。)につき一切の責任を負わないものとします。&nbsp;第2章　会員資格第5条　会員登録サービスを利用するためには、本サイトにて会員登録をしていただく必要があります。会員登録に際しては弊社が本サイト会員登録フォームにて指定する個人情報等をご提供いただく必要がありますことをご了解ください。会員登録手続は、会員となる本人が行う必要があり、会員となる本人以外が行う登録は一切認められません。会員が、会員登録時及び会員登録後に弊社が提供するサービスを利用するにあたり、虚偽の登録を行うことを禁止します。会員は、真実かつ正確な情報を登録する義務を負い','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2024-09-04 17:48:58',23),(223,'协议管理',2,'com.huizu.web.controller.system.SysAgreementController.edit()','PUT',1,'admin','研发部门','/system/agreement','104.192.92.223','XX XX','{\"content\":\"プライバシーポリシー&nbsp;WaysLink株式会社（以下「当社」といいます。）は、個人情報保護の重要性を認識し、お客様の氏名、住所、生年月日、電話番号、eメールアドレス、銀行口座番号、クレジットカードに関する情報、SNSのアカウント情報等お客様を特定することができる情報（以下「個人情報」といいます。）を保護することが社会的責務であると考え、個人情報に関する法令及び社内規程等を遵守し、当社で取扱う個人情報の取得、利用、管理を適正に行います。&nbsp;１．個人情報の取得・利用目的当社は、お客様からいただく個人情報の利用目的をあらかじめ明確に定め、適法かつ公正な手段により、必要な範囲で個人情報を取得し、以下の利用目的の範囲内において、個人情報を利用させて頂きます。&nbsp;1.&nbsp;当社が運営する自動車の相乗りに係るマッチングのためのプラットフォームサイト（以下「本サイト」といいます。）の運営（以下「本運営」といいます。）及びそれに付帯するサービスの提供のため2.&nbsp;本サイトを利用する他の会員に、お客様が同意された範囲内の個人情報を提供するため3.&nbsp;本運営における当社サービスに関する情報のお知らせのため4.&nbsp;お客様からのお問い合わせ又はご依頼等への対応のため5.&nbsp;お客様に対してサービスについてご意見をお伺いするため6.&nbsp;本運営・キャンペーン等に関する情報をご提供するため7.&nbsp;アンケートやキャンペーンによる謝礼・賞品など、イベントの企画・運営のため8.&nbsp;本運営の内容改善や統計情報などに用いるため&nbsp;２．個人情報の委託当社は、利用目的の達成に必要な範囲内において、契約関係にある業務提携先に個人情報処理を委託する場合など、利用目的の達成に必要な範囲内において、お客様の個人情報を外部業者に委託することがあります。&nbsp;３．第三者提供当社は、前項の目的及び次のいずれかに該当する場合を除き、お客様から取得した個人情報を、第三者に提供しません。&nbsp;1.&nbsp;お客様ご本人の同意がある場合2.&nbsp;法令に基づく場合3.&nbsp;人の生命、身体又は財産の保護のために必要がある場合であって、お客様ご本人の同意を得ることが困難であるとき4.&nbsp;国の機関若しくは地方公共団体又はその委託を受けた者が法令の定める事務を遂行することに対して協力する必要がある場合であって、お客様ご本人の同意を得ることにより当該事務の遂行に支障を及ぼす恐れがあるとき5.&nbsp;合併、会社分割、営業譲渡その他の事由によって事業の承継が行われる場合&nbsp;４．訂正、追加又は削除当社が保有するお客様情報に関して、お客様ご自身の情報の内容について訂正、追加または削除をご希望になる場合には、お申し出いただいた方がご本人であることを確認した上で、事実と異なる内容がある場合には、合理的な期間及び範囲で情報内容を訂正、追加または削除いたします。&nbsp;５．利用停止、消去当社が保有するお客様情報に関して、お客様ご自身の情報の利用停止または消去をご希望される場合には、お申し出いただいた方がご本人であることを確認した上で、合理的な期間および範囲で利用停止または消去いたします。なお、利用停止又は消去に伴い、不本意ながらご要望に沿ったサービスの提供ができなくなることがありますので、ご理解とご協力を賜りますようお願い申し上げます（なお、関係法令に基づき保有しております個人情報については、利用停止又は消去のご請求には応じられない場合があります）。&nbsp;6．準拠法について当社が保有するお客様の個人情報については日本国法を適用します。また、当社は個人情報について適用される法令を遵守し、法令の変更等、必要に応じて各項目の変更を行ないます。&nbsp;7. クッキー、アクセスログ、webビーコン本サイトでは、利便性の向上、内容の充実、不正アクセスの防止等を目的として、Cookie（ブラウザを通してPC上に保存されるファイル）やアクセスログ（アクセス状況等をサーバ上に記録するファイル）、WEBビーコン（特定ページへのアクセス数を記録する等の目的で、WEBサイト上に組み込まれる画像ファイル）を使用する場合があります。取得・利用する情報は、IPアドレス、ブラウザの種類、閲覧したページ等になります。Cookie、アクセスログ、WEBビーコンいずれについても、利用者名やメールアドレス等の個人情報は取得致しません。&nbsp;8．個人情報に関するお問い合わせお客様からお客様ご本人の個人情報についての開示・訂正・利用停止等のご依頼や、その他苦情・相談等のお申し出があっ','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2024-09-04 17:49:40',10),(224,'协议管理',2,'com.huizu.web.controller.system.SysAgreementController.edit()','PUT',1,'admin','研发部门','/system/agreement','104.192.92.223','XX XX','{\"content\":\"<p class=\\\"ql-align-center\\\"><strong>事業者</strong></p><p>WaysLink株式会社</p><p>（英語表記：WaysLink, Inc.）</p><p class=\\\"ql-align-center\\\"><strong>代表者</strong></p><p>上地佑来</p><p class=\\\"ql-align-center\\\"><strong>事業内容</strong></p><p>女性専用ライドシェア「Wely」の運営</p><p class=\\\"ql-align-center\\\"><strong>所在地</strong></p><p>〒901-1104　沖縄県南風原町字宮平894－11</p><p>（代表電話番号：　　　　）</p><p class=\\\"ql-align-center\\\"><strong>メールアドレス</strong></p><p>info@wayslink.me</p><p class=\\\"ql-align-center\\\"><strong>販売価格（役務の対価)</strong></p><p>商品毎に記載（すべて消費税込）</p><p class=\\\"ql-align-center\\\"><strong>お支払時期</strong></p><p>ドライブが実際に行われた時</p><p class=\\\"ql-align-center\\\"><strong>役務の提供時期</strong></p><p>ドライブ情報に設定された日時</p><p class=\\\"ql-align-center\\\"><strong>キャンセルについて</strong></p><p>無料</p><p class=\\\"ql-align-center\\\"><strong>販売価格（役務の対価）</strong></p><p class=\\\"ql-align-center\\\"><strong>以外の必要料金</strong></p><p>なし</p><p class=\\\"ql-align-center\\\"><strong>ご連絡</strong></p><p>info@wayslink.me</p>\",\"createBy\":\"\",\"delFlag\":0,\"id\":1,\"params\":{},\"status\":1,\"type\":\"11\",\"updateBy\":\"\",\"updateTime\":\"2024-09-04 17:55:01\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2024-09-04 17:55:01',61),(225,'协议管理',2,'com.huizu.web.controller.system.SysAgreementController.edit()','PUT',1,'admin','研发部门','/system/agreement','104.192.92.223','XX XX','{\"content\":\"<p class=\\\"ql-align-center\\\">Wely サービス利用規約</p><p>&nbsp;</p><p><br></p><h1 class=\\\"ql-align-center\\\">第1章　はじめに</h1><h2>第1条　定義等</h2><p>本規約はWaysLink株式会社（以下「弊社」といいます。）がウェブサイト（wely.info）（以下「本サイト」といいます。）を運営することにより提供するサービスについて適用されます。</p><p>本規約の中で使用される以下の各用語は、次の通りとします。</p><p>&nbsp;</p><p>「ライド・シェア」とは、自動車のドライバー（以下「ドライバー」といいます。）と相乗り希望者（以下「利用者」といいます。）が自動車の相乗り行為を行うことを指します。</p><p>「本規約」とは、本サービス利用規約を指しますが、弊社が本サービスの運営にあたり別途規定する「本サービスご利用上の注意点」「FAQ」など、本サイト上に掲示する各種ルール、各種取り決めも本規約の一部を構成するものとします。</p><p>「参考実費」とはドライブに要するガソリン代、有料道路使用料、移動サービス専用保険料の見込み合計額をいいます。</p><p>「支払い金額」とはドライブ当日の利用者の人数に応じて自動計算により算出した、一人当たりにご負担いただく費用をいい、全ての利用者の支払い金額の合計は参考実費以下である必要があります。</p><p>「ドライバー」とは、本サイトを利用して、ドライブ情報（出発・到着日時、出発場所、経由場所、到着場所等）及び条件（乗車可能人数、ドライブに要する支払い金額）を登録して、利用者からのライド・シェアの申し込みを承認し、ライド・シェアを行う者をいいます。</p><p>「利用者」とは、本サイトを利用して、ドライブ情報を検索及び自ら移動ルートの希望条件（出発・到着日時、出発場所、経由場所、到着場所等）を登録しして、ドライバーからのライド・シェアの申込の誘因を受け、ライド・シェアの申込を行う者をいいます。</p><p>「会員」とは、本規約を承認し、サービスを利用するために弊社所定の入会登録を行い、弊社がその入会登録を承認した個人、法人及び団体をいいます。</p><p>「会員等」とは、会員、会員登録の申込者及び本サイトの閲覧者など、本サイトの利用を認められる個人、法人及び団体をいい、特に断らない限り、サイト閲覧者も含まれるものとします。</p><p>「サービス」とは、本サイトにおいて会員が利用することができるサービスをいいます。</p><p>「ユーザーアカウント」とは、会員によって本サイトに開設されサービスを享受するために利用されるアカウントをいいます。</p><p>&nbsp;</p><p><br></p><h2>第2条　本規約への同意</h2><p>サービスを利用するには、本規約に同意の上、会員となる必要があります。本規約は、本サイトを利用するあらゆる場面に適用されます。本サイトを利用する場合、会員は、本規約の各条項が適用されることを承諾していただく必要があります。本規約の各条項が適用されることを承諾いただけない場合には、サービスをご利用になれません。また、会員が本規約の各条項に従うことができない場合には、弊社は、事前通知なく当該会員のユーザーアカウントを削除し、あらゆるサービスの提供を停止せざるを得なくなることをご了解ください。</p><p>本規約は、全ての会員に適用され、会員登録手続時及び登録後に、お守りいただくことが必要となります。</p><p>&nbsp;</p><p><br></p><h2>第3条　個人情報保護方針への同意</h2><p>本サービスは、個人情報保護方針に従って提供され、会員の個人情報は、当該個人情報保護方針に従って取り扱われます。</p><p>会員等は、サービスの利用又は本サイトの閲覧の前に、個人情報保護方針を必ず確認し、その内容に同意の上、サービスのご利用又は本サイトの閲覧をしてください。</p><p>&nbsp;</p><p><br></p><h2>第4条　規約の変更・追加</h2><p>弊社は、いかなる場合でも会員等に事前に通知することなく、本規約の全部又は一部を任意に変更でき、また本規約を補充する規約・特約を新たに定めることができるものとします。規約の変更・追加は、本サイトに掲示した時点から効力を有するものとします。</p><p>会員等は、前項の内容を十分に理解し、定期的に本規約の最新の内容を確認する義務を負うものとし、弊社に対して、規約の変更・追加に関する不知を申し立てることを禁止します。</p><p>弊社は、規約の変更','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2024-09-04 17:55:28',27),(226,'协议管理',2,'com.huizu.web.controller.system.SysAgreementController.edit()','PUT',1,'admin','研发部门','/system/agreement','104.192.92.223','XX XX','{\"content\":\"<p class=\\\"ql-align-center\\\">プライバシーポリシー</p><p>&nbsp;</p><p>WaysLink株式会社（以下「当社」といいます。）は、個人情報保護の重要性を認識し、お客様の氏名、住所、生年月日、電話番号、eメールアドレス、銀行口座番号、クレジットカードに関する情報、SNSのアカウント情報等お客様を特定することができる情報（以下「個人情報」といいます。）を保護することが社会的責務であると考え、個人情報に関する法令及び社内規程等を遵守し、当社で取扱う個人情報の取得、利用、管理を適正に行います。</p><p>&nbsp;</p><p><br></p><h2>１．個人情報の取得・利用目的</h2><p>当社は、お客様からいただく個人情報の利用目的をあらかじめ明確に定め、適法かつ公正な手段により、必要な範囲で個人情報を取得し、以下の利用目的の範囲内において、個人情報を利用させて頂きます。</p><p>&nbsp;</p><p>1.&nbsp;当社が運営する自動車の相乗りに係るマッチングのためのプラットフォームサイト（以下「本サイト」といいます。）の運営（以下「本運営」といいます。）及びそれに付帯するサービスの提供のため</p><p>2.&nbsp;本サイトを利用する他の会員に、お客様が同意された範囲内の個人情報を提供するため</p><p>3.&nbsp;本運営における当社サービスに関する情報のお知らせのため</p><p>4.&nbsp;お客様からのお問い合わせ又はご依頼等への対応のため</p><p>5.&nbsp;お客様に対してサービスについてご意見をお伺いするため</p><p>6.&nbsp;本運営・キャンペーン等に関する情報をご提供するため</p><p>7.&nbsp;アンケートやキャンペーンによる謝礼・賞品など、イベントの企画・運営のため</p><p>8.&nbsp;本運営の内容改善や統計情報などに用いるため</p><p>&nbsp;</p><p><br></p><h2>２．個人情報の委託</h2><p>当社は、利用目的の達成に必要な範囲内において、契約関係にある業務提携先に個人情報処理を委託する場合など、利用目的の達成に必要な範囲内において、お客様の個人情報を外部業者に委託することがあります。</p><p>&nbsp;</p><p><br></p><h2>３．第三者提供</h2><p>当社は、前項の目的及び次のいずれかに該当する場合を除き、お客様から取得した個人情報を、第三者に提供しません。</p><p>&nbsp;</p><p>1.&nbsp;お客様ご本人の同意がある場合</p><p>2.&nbsp;法令に基づく場合</p><p>3.&nbsp;人の生命、身体又は財産の保護のために必要がある場合であって、お客様ご本人の同意を得ることが困難であるとき</p><p>4.&nbsp;国の機関若しくは地方公共団体又はその委託を受けた者が法令の定める事務を遂行することに対して協力する必要がある場合であって、お客様ご本人の同意を得ることにより当該事務の遂行に支障を及ぼす恐れがあるとき</p><p>5.&nbsp;合併、会社分割、営業譲渡その他の事由によって事業の承継が行われる場合</p><p>&nbsp;</p><p><br></p><h2>４．訂正、追加又は削除</h2><p>当社が保有するお客様情報に関して、お客様ご自身の情報の内容について訂正、追加または削除をご希望になる場合には、お申し出いただいた方がご本人であることを確認した上で、事実と異なる内容がある場合には、合理的な期間及び範囲で情報内容を訂正、追加または削除いたします。</p><p>&nbsp;</p><p><br></p><h2>５．利用停止、消去</h2><p>当社が保有するお客様情報に関して、お客様ご自身の情報の利用停止または消去をご希望される場合には、お申し出いただいた方がご本人であることを確認した上で、合理的な期間および範囲で利用停止または消去いたします。なお、利用停止又は消去に伴い、不本意ながらご要望に沿ったサービスの提供ができなくなることがありますので、ご理解とご協力を賜りますようお願い申し上げます（なお、関係法令に基づき保有しております個人情報については、利用停止又は消去のご請求には応じられない場合があります）。</p><p>&nbsp;</p><p><br></p><h2>6．準拠法について</h2><p>当社が保有するお客様の個人情報については日本国法を適用します。また、当社は個人情報について適用される法令を遵守し、法令の変更等、必要に応じて各項目の変更を行ないます。</p><p>&nbsp','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2024-09-04 17:55:38',20),(227,'协议管理',2,'com.huizu.web.controller.system.SysAgreementController.edit()','PUT',1,'admin','研发部门','/system/agreement','104.192.92.223','XX XX','{\"content\":\"<p class=\\\"ql-align-center\\\"><strong class=\\\"ql-size-huge\\\">Wely サービス利用規約</strong></p><p><span class=\\\"ql-size-huge\\\">&nbsp;</span></p><p><br></p><p><br></p><h1 class=\\\"ql-align-center\\\">第1章　はじめに</h1><h2>第1条　定義等</h2><p>本規約はWaysLink株式会社（以下「弊社」といいます。）がウェブサイト（wely.info）（以下「本サイト」といいます。）を運営することにより提供するサービスについて適用されます。</p><p>本規約の中で使用される以下の各用語は、次の通りとします。</p><p>&nbsp;</p><p>「ライド・シェア」とは、自動車のドライバー（以下「ドライバー」といいます。）と相乗り希望者（以下「利用者」といいます。）が自動車の相乗り行為を行うことを指します。</p><p>「本規約」とは、本サービス利用規約を指しますが、弊社が本サービスの運営にあたり別途規定する「本サービスご利用上の注意点」「FAQ」など、本サイト上に掲示する各種ルール、各種取り決めも本規約の一部を構成するものとします。</p><p>「参考実費」とはドライブに要するガソリン代、有料道路使用料、移動サービス専用保険料の見込み合計額をいいます。</p><p>「支払い金額」とはドライブ当日の利用者の人数に応じて自動計算により算出した、一人当たりにご負担いただく費用をいい、全ての利用者の支払い金額の合計は参考実費以下である必要があります。</p><p>「ドライバー」とは、本サイトを利用して、ドライブ情報（出発・到着日時、出発場所、経由場所、到着場所等）及び条件（乗車可能人数、ドライブに要する支払い金額）を登録して、利用者からのライド・シェアの申し込みを承認し、ライド・シェアを行う者をいいます。</p><p>「利用者」とは、本サイトを利用して、ドライブ情報を検索及び自ら移動ルートの希望条件（出発・到着日時、出発場所、経由場所、到着場所等）を登録しして、ドライバーからのライド・シェアの申込の誘因を受け、ライド・シェアの申込を行う者をいいます。</p><p>「会員」とは、本規約を承認し、サービスを利用するために弊社所定の入会登録を行い、弊社がその入会登録を承認した個人、法人及び団体をいいます。</p><p>「会員等」とは、会員、会員登録の申込者及び本サイトの閲覧者など、本サイトの利用を認められる個人、法人及び団体をいい、特に断らない限り、サイト閲覧者も含まれるものとします。</p><p>「サービス」とは、本サイトにおいて会員が利用することができるサービスをいいます。</p><p>「ユーザーアカウント」とは、会員によって本サイトに開設されサービスを享受するために利用されるアカウントをいいます。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第2条　本規約への同意</h2><p>サービスを利用するには、本規約に同意の上、会員となる必要があります。本規約は、本サイトを利用するあらゆる場面に適用されます。本サイトを利用する場合、会員は、本規約の各条項が適用されることを承諾していただく必要があります。本規約の各条項が適用されることを承諾いただけない場合には、サービスをご利用になれません。また、会員が本規約の各条項に従うことができない場合には、弊社は、事前通知なく当該会員のユーザーアカウントを削除し、あらゆるサービスの提供を停止せざるを得なくなることをご了解ください。</p><p>本規約は、全ての会員に適用され、会員登録手続時及び登録後に、お守りいただくことが必要となります。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第3条　個人情報保護方針への同意</h2><p>本サービスは、個人情報保護方針に従って提供され、会員の個人情報は、当該個人情報保護方針に従って取り扱われます。</p><p>会員等は、サービスの利用又は本サイトの閲覧の前に、個人情報保護方針を必ず確認し、その内容に同意の上、サービスのご利用又は本サイトの閲覧をしてください。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>第4条　規約の変更・追加</h2><p>弊社は、いかなる場合でも会員等に事前に通知することなく、本規約の全部又は一部を任意に変更でき、また本規約を補充する規約・特約を新たに定めることができるものとします。規約の変更・追加は、本サイトに掲示した時点','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2024-09-04 17:56:43',15),(228,'协议管理',2,'com.huizu.web.controller.system.SysAgreementController.edit()','PUT',1,'admin','研发部门','/system/agreement','104.192.92.223','XX XX','{\"content\":\"<p class=\\\"ql-align-center\\\"><strong class=\\\"ql-size-huge\\\">プライバシーポリシー</strong></p><p>&nbsp;</p><p>WaysLink株式会社（以下「当社」といいます。）は、個人情報保護の重要性を認識し、お客様の氏名、住所、生年月日、電話番号、eメールアドレス、銀行口座番号、クレジットカードに関する情報、SNSのアカウント情報等お客様を特定することができる情報（以下「個人情報」といいます。）を保護することが社会的責務であると考え、個人情報に関する法令及び社内規程等を遵守し、当社で取扱う個人情報の取得、利用、管理を適正に行います。</p><p>&nbsp;</p><p><br></p><p><br></p><h2>１．個人情報の取得・利用目的</h2><p>当社は、お客様からいただく個人情報の利用目的をあら