--
-- Table structure for table `tb_customer_route`
--

DROP TABLE IF EXISTS `tb_customer_route`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tb_customer_route` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `customer_id` int(10) DEFAULT NULL COMMENT '用户id',
  `type` char(1) DEFAULT NULL COMMENT '类型（1司机 2用户）',
  `describe` varchar(255) DEFAULT NULL COMMENT '描述',
  `start_time` datetime DEFAULT NULL COMMENT '出发时间',
  `end_time` datetime DEFAULT NULL COMMENT '到达时间',
  `start_address` varchar(255) DEFAULT NULL COMMENT '出发地址',
  `end_address` varchar(255) DEFAULT NULL COMMENT '目的地址',
  `start_lon_lat` varchar(255) DEFAULT NULL COMMENT '出发地经纬度',
  `end_lon_lat` varchar(255) DEFAULT NULL COMMENT '目的地经纬度',
  `model` varchar(255) DEFAULT NULL COMMENT '车型号',
  `number` varchar(255) DEFAULT NULL COMMENT '车牌号',
  `price` decimal(10,2) DEFAULT NULL COMMENT '单价',
  `total` int(10) DEFAULT NULL COMMENT '可乘坐数量',
  `already_total` int(10) DEFAULT '0' COMMENT '已乘坐数量',
  `attention` varchar(1000) DEFAULT NULL COMMENT '事前注意事项',
  `comment` varchar(1000) DEFAULT NULL COMMENT '评论',
  `view_total` int(10) DEFAULT NULL COMMENT '访问人数',
  `state` varchar(255) DEFAULT NULL COMMENT '重复设定',
  `route_state` char(1) DEFAULT NULL COMMENT '订单状态，待接客，客已满，行驶中，结束',
  `status` char(1) DEFAULT NULL COMMENT '状态（0停用 1启用）',
  `create_by` varchar(32) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `del_flag` char(1) DEFAULT NULL COMMENT '删除标记（0正常，1删除）',
  `standby1` varchar(255) DEFAULT NULL COMMENT '备用1',
  `standby2` varchar(255) DEFAULT NULL COMMENT '备用2',
  `standby3` varchar(255) DEFAULT NULL COMMENT '备用3',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=59 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='行程管理;';
/*!40101 SET character_set_client = @saved_cs_client */;

