-- Table structure for table `tb_route_detail`
--

DROP TABLE IF EXISTS `tb_route_detail`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tb_route_detail` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `route_id` int(10) DEFAULT NULL COMMENT '行程id',
  `total` varchar(255) DEFAULT NULL COMMENT '同乘人数',
  `price` varchar(255) DEFAULT NULL COMMENT '价格',
  `status` char(1) DEFAULT NULL COMMENT '状态（0停用 1启用）',
  `create_by` varchar(32) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `del_flag` char(1) DEFAULT NULL COMMENT '删除标记（0正常，1删除）',
  `standby1` varchar(255) DEFAULT NULL COMMENT '备用1',
  `standby2` varchar(255) DEFAULT NULL COMMENT '备用2',
  `standby3` varchar(255) DEFAULT NULL COMMENT '备用3',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='行程资金明细;';
/*!40101 SET character_set_client = @saved_cs_client */;

